var TW = TW || {};
TW.SDK = TW.SDK || {};
TW.SDK.Types = TW.SDK.Types || {};

TW.SDK.Types.DataShape = function (config) {
    var fieldDefinitions = {};
    if (config) {
        if (config.fieldDefinitions) {
            fieldDefinitions = config.fieldDefinitions;
        }
    }
    var api = {
        fieldDefinitions: fieldDefinitions
    };
    return api;
};
